public class GeneraliApiClient {

	static final String apiManagerBasePath = "https://api.apim.ibmcloud.com/robertopozziitibmcom-dev/sb";
	static final String clientID = "";
	static final String clientSecret = "";

	public static void main(String[] args) {
		_callApiUploadDoc();
	}

	private static void _callApiUploadDoc() {
		System.out.println("$$$$$$$$$$$$$$$$$ Calling Generali Api Upload doc - START $$$$$$$$$$$$$$$$$");
		FileInputStream fileInputStreamReader = null;
		try {
			//String resourcePath = "/generali/docs";
			String resourcePath = "/generali/signature/docs";

			String path = apiManagerBasePath + resourcePath;
			System.out.println("Calling through path " + path);

			//path += "?client_id=" + clientID + "&client_secret=" + clientSecret;
			
			//====================			
			File file = new File("C:/Customers/Generali/2015-Bluemix/ServiceHub/Test.pdf");
			long length = file.length();
			byte[] bytes = new byte[(int) length];
			System.out.println("FILE LENGTH = " + length);
			fileInputStreamReader = new FileInputStream(file);
	        fileInputStreamReader.read(bytes);
	        byte[] encodedBytes = Base64.encode(bytes);
	        String encodedString = new String(encodedBytes).trim();
	        System.out.println("encodedfile STRING LENGTH = " + encodedString.length());
			System.out.println(encodedString);
			//====================
			encodedString = "TEST";
			String input = "{\"docId\":\"RP-003\",\"docbase64\":\""+ encodedString + "\"}";
			
			/*
			Client client = Client.create();
			WebResource webResource = client.resource(path);
			ClientResponse response = webResource.type("application/json").post(ClientResponse.class, input);
			*/
			
			// create the rest client instance
			Client client = ClientBuilder.newClient();
			// create the Builder instance to interact with
			WebTarget webTarget = client.target(path);
			Invocation.Builder invocationBuilder = webTarget.request(MediaType.APPLICATION_JSON);
			// perform a POST on the resource.
			Entity<String> entity = Entity.entity(input, MediaType.APPLICATION_JSON);
			Response response = invocationBuilder.post(entity);
			System.out.println(response.getStatus());
			String jsonStr = response.readEntity(String.class);
			System.out.println(jsonStr);
		} catch (FileNotFoundException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		} finally {
			try {
				if (fileInputStreamReader != null) {
					fileInputStreamReader.close();
				}
			} catch (IOException e) {
				e.printStackTrace();
			}
			System.out.println("$$$$$$$$$$$$$$$$$ Calling Generali Api Upload doc - END $$$$$$$$$$$$$$$$$");
		}
	}		
}


